import React, { useState } from "react";
import { Link } from "react-router-dom";

export default function TeamComp({ teams }) {
  // central: {},
  // atlantic: {},
  // southeast: {},
  // southwest: {},
  // pacific: {},
  // northwest: {}

  return (
    <>
      <h3>Teams List</h3>
      <div className="team-list">
        {teams.map((team, i) => {
          return (
            <Link to={`/teams/${team.abbreviation}`}>
              <p>{team.full_name}</p>
            </Link>
          );
        })}
      </div>
    </>
  );
}
